Ses amis d'enfance sont le Chat du Cheshire et le chapeau d'Alice au Pays des Merveilles. Elle aime la photographie, l'écriture, le dessin et la composition musicale à la guitare.
Son art est une source d'inspiration, mais pas directe, les œuvres romantiques-décadentes de la littérature et les dessins gothiques-romantiques de Victoria Frances. La passion pour la photographie se développe en elle après avoir admiré chefs-d'œuvre d'Ansel Adams. Sa recherche dans le domaine de la photographie, de manière autodidacte, s'effectue de façon continue depuis 2008.

"Pour moi, la photographie, c'est faire un voyage introspectif dans mon âme, à travers des décisions prises sur des sujets réels."

Eleonora a exposé certaines de ses œuvres dans une collection de peintures dans l'église des Arméniens à Livourne à Effetto Venezia 2010. Depuis mai 2011, elle travaille aussi sur commande.
A été nommé artiste de la semaine sur Weeklart  obtenir une récompense une exposition en ligne par 13 Juin 19, 2011
