Ils se sont rencontrés en 2007 par l’intermédiaire de leurs professions. 

Fin 2009, ils décident ensemble de fabriquer une machine qui donnerait un nouvel impact dans le monde de la musique. 
Après quelques semaines de conception, le projet Re@cstable était né. 

Un fût toxique, une webcam, des formes abstraites imprimées sur des cubes… 
Chaque cube présenté à la webcam est reconnu et déclenche un « sample », un rythme ou un effet, un peu à la manière d’un code barre. 

S’inspirant d’un projet de fin d’année de l’université de Barcelone, la version belge a pour particularité d’être faite « main » à partir de matériaux de récupération, et adaptée pour le « live ». 

