Je m'intitule Jérémy Pepe et je suis né à Genève le 19 février 1990 en Suisse.

Ayant toujours été fasciné par la beauté du monde qui m'entoure, j'utilise l'appareil photo pour essayer de partager les émotions que je peux ressentir chaque fois que j'aperçois quelque chose de nouveau, de spécial, d'apaisant ou tout simplement qui passera un message...

Pour moi, la photo n'est pas qu'une passion, c'est un moyen que j'ai de m'échapper, la musique dans les oreilles, l'appareil dans les mains et le vide dans la tête, j'aime la sensation de me retrouver seul, que cela soit près des gens, dans la foule ou dans la nature, loin de tout.

J'ai deux citations qui pourraient parfaitement illustrer mes opinions sur la photographie.

J'ai lu quelque part "[I]l faut aimer la solitude pour être photographe". Cette citation est pour moi très juste car, sans cette solitude, cette sensation d'être comme le dernier Homme sur Terre, l'inspiration ne me vient pas...

La deuxième citation dont je vous ferais part est celle de Bill Brandt. "Cela fait partie du travail du photographe de voir plus intensément que la plupart des gens. Il doit avoir et garder en lui quelque chose de la réceptivité de l'enfant qui regarde le monde pour la première fois ou du voyageur qui pénètre dans un pays étrange. "
Cette citation veut tout dire pour moi. Le fait de voir ce qui m'entoure comme un bambin qui s'émerveille en voyant une nouvelle fleur, un paysage insolite, un coucher de Soleil hors du commun ou une luminosité particulière sur un objet, banal ou non, m'inspire et me fait voir le Monde comme peut-être trop peu de gens prennent le temps de le faire...

À travers les images que vous verrez, je me suis donné pour but de vous faire passer un message. Plus que de vous "stupéfier" par la beauté de certaines photos que j'ai pu prendre, je voudrais vous partager mon amour pour cette Terre et ses habitants, animaux et êtres humains. Mais je voudrais surtout vous dire: "regardez autour de vous et pas seulement devant vos pieds" car la beauté n'est qu'éphémère et notre Terre, change, meurt, bien trop vite à mon goût.

Voilà tout pour le moment et c'est déjà bien assez...

Alors je vous souhaite un bon moment sur mon site et si je ne vous transmets, ne serait-ce qu'un dixième de ce que je voudrais, j'en serais ravi.

Bonne visite à tous!


Je finirai par ces paroles de Renaud : 


"Je voudrais être un arbre et plonger mes racines
au coeur de cette terre que j'aime tellement
et que ce putain d'homme chaque jour assassine
je voudrais le silence enfin, et puis le vent..."


Pepe Jérémy



N'hésitez pas à commenter et à faire partager, ça fait toujours plaisir :)

