Dès l'âge de 10 ans, mes jouets sont des pinceaux et des tubes à l’huile. Dessinateur, je perfectionne ma peinture d’année en année pendant les vacances chez un peintre en Bretagne. 

  

L’expression pour moi est Art ; Mon parcours est jalonné de rencontres, de techniques découvertes au gré de mes voyages ; (Afrique ; Asie ; Amérique latine) ; de mon regard sur le monde et la nature. 

  

Art langage universel qui réconcilie les solitudes, les émotions humaines et transcende les sensibilités. 

Solitaire dans la création, le besoin de communication et de partage s’impose par l’exposition, les rencontres. 

  

L’Art, c’est le regard, mon expression est souffle vital ; 

  

Elle s’enrichit de mon expérience de vie, des rencontres, des émotions ressenties. Je ne suis pas « homme de mots » mais « homme de matières ». L ‘encre est le point commun. 

  

L’essentiel est dans le partage entre œuvres et regards, tout se joue alors; 

  

Mon Oxygène, c'est l'Art.  

";s:8:"category";s:20:"Peinture / Coloriste";s:4:"pays";s:6:"France";s:15:"social_facebook";s:0:"";s:14:"social_twitter";s:0:"";s:13:"social_flickr";s:0:"";s:14:"social_myspace";s:0:"";s:17:"social_soundcloud";s:0:"";s:12:"social_vimeo";s:0:"";s:7:"created";s:19:"2011-06-10 10:16:13";s:8:"modified";s:19:"2011-06-10 10:26:00";}s:13:"ArtisteCompte";a:4:{s:2:"id";s:3:"245";s:6:"statut";s:5:"light";s:7:"created";s:19:"2011-06-10 10:16:13";s:8:"modified";s:19:"2011-06-10 10:16:13";}s:4:"Site";a:19:{s:2:"id";s:4:"2388";s:3:"url";s:20:"art-alain-carpentier";s:5:"title";s:21:"ART- Alain Carpentier";s:4:"logo";s:0:"";s:6:"slogan";s:12:"Votre Slogan";s:10:"id_gabarit";s:2:"13";s:11:"id_template";s:3:"360";s:11:"id_page_bio";s:4:"1717";s:12:"id_page_work";s:4:"1718";s:15:"id_page_contact";s:4:"1719";s:15:"id_page_galerie";s:3:"465";s:18:"id_page_evenements";s:4:"1720";s:9:"page_home";s:1:"5";s:10:"publishing";s:1:"0";s:8:"annuaire";s:1:"0";s:16:"annuaire_capture";s:22:"screenshot_default.jpg";s:10:"authorized";s:1:"0";s:7:"created";s:19:"2011-06-10 10:16:13";s:8:"modified";s:19:"2011-06-10 10:26:00";}s:4:"User";a:10:{s:2:"id";s:3:"283";s:10:"artiste_id";s:3:"263";s:5:"fb_id";s:0:"";s:8:"username";s:20:"art-alain-carpentier";s:8:"password";s:32:"b3b6bda9f4995d78a9add9f873568a24";s:5:"email";s:20:"pascacarp@hotmail.fr";s:5:"admin";s:1:"0";s:7:"actived";s:1:"1";s:7:"created";s:19:"2011-06-10 10:16:13";s:8:"modified";s:19:"2011-06-10 10:26:00";}}i:147;a:4:{s:7:"Artiste";a:21:{s:2:"id";s:3:"262";s:7:"user_id";s:3:"282";s:7:"site_id";s:4:"2367";s:16:"artistecompte_id";s:3:"244";s:3:"url";s:27:"gloria-and-the-greenspiders";s:5:"blase";s:27:"Gloria and The GreenSpiders";s:3:"nom";s:9:"Sometimes";s:6:"prenom";s:6:"Gloria";s:9:"id_avatar";s:117:"http://media.you-art-here.com/upload/gloria-and-the-greenspiders/avatar/Capture d’écran 2011-07-07 à 11.10.10.png";s:6:"slogan";s:16:"ApocalipstikShow";s:11:"description";s:4066:"Parfois, dans les concerts, le spectateur voit des groupes qui sont vraiment très bien. Rien à dire. Et puis un autre groupe monte sur scène et il se dit : « Ah oui, là, il y a une différence… ». La différence ? Ces groupes-là ont un chanteur, un vrai. Ou une chanteuse, une vraie. Quelqu’un qui occupe la scène, qui impose une présence. Pas besoin de faire des vocalises ou de se rouler par terre. Non, il s’agit plutôt d’un magnétisme, d’une certaine façon d’habiter l’espace, fut-ce de manière timide. Gloria, la chanteuse des Greenspiders, est de ceux-là. Elle monte sur scène, le groupe se lance et quelque chose se passe. Qu’on ne s’y trompe pas, c’est pas tous les samedis soirs de bourrance que ça arrive à notre spectateur. Le son des Greenspiders ? Du sixties pur et dur, du garage peint en rose, guitares tantôt claires, tantôt acérées, qui jouent au ping pong, tricotent méchamment leur toile pendant que la demoiselle aux soquettes déchirées, mi Bardot mi Courtney Love, balance ses aphorismes énigmatiques, élégante comme un sphinx qui chaloupe sur ses talons hauts. « Quand tu es bout du chemin, je suis au début du mien… » Les Greenspiders se réclament de groupes commes les Seeds ou des compilations « Swinging Mademoiselle », qui réunissaient des chanteuses yéyé oubliées, dont les noms ne sont plus connus que par une poignée de mordus : les Zouzou, Clotilde, Stella ou Christine Pilzer. Une attitude frenchy but chic, plus racée que France Gall, moins poseuse que les Anna Karina ou les Jeanne Moreau de la Nouvelle Vague. Pourquoi pas ? Mais les Greenspiders échappent à toute posture trop nostalgique, trop revivaliste. Sans doute parce qu’ils jouent 67 en se rappelant que 77 va arriver. Grégoire (guitare), Yann (guitare) et José Baldo (batterie) connnaissent trop bien leur rock pour tomber dans le panneau du pastiche. Même chose pour Gloria. Elle ne nous fait pas le coup de la chanteuse à moue façon Bardot. Ou de la lollypopeuse façon France Gall. Elle ne se prend pas pour une punkette 77, rageuse et arrogante. Elle ne se prend pour personne, en fait. Il se dégage d’elle quelque chose d’à la fois tendu et réservé, d’inquiet et de jubilant, qui indique que, pour elle, ça se passe là, ici et maintenant. C’est sa vie qu’elle joue et qui est en jeu. Comme tous les chanteurs de rock. La preuve : ses paroles en français, qu’elle écrit elle-même. Simples, mystérieuses, et qui, quand elles sont posées sur sa bouche, font mouche. « Mauvaise », « Déteste-moi », « Haute Couture ». Dès l’âge de 12 ans, elle commence à rédiger rageusement des textes dans sa chambre picarde en rêvant à Lou Reed, T-Rex, Marianne Faithfull, ou Patrick Eudeline. Des paroles 2010 sur une musique 60’s. « Je suis la plus mauvaise/La plus cynique/La plus sadique/La plus BAM BAM… » (« Mauvaise »). « C’est avec ta peau que je suis cousue/Mes bas ne tiennent qu’à toi/Si tu t’éloignes, c’est tout troué que tu finiras… » (« Haute Couture »). « Moi, la nuit, pour voir clair/Je mets les doigts dans la prise… ». Et quand elle chante en anglais « I don’t care/I don’t care/I don’t care… », incroyable : on y croit vraiment. Depuis qu’elle est montée à Paris, Gloria a rencontré quelques-unes de ses idoles. Virginie Despentes, Daniel Darc ou Patrick Eudeline, l’incontournable Prince Noir, qui l’a adoubée et la couve de sa royale protection. Elle a usé ses fonds de bas et fait couler son mascara dans les concerts, dans les bars, dans les boutiques de fripes, dans les boulots pourris… Elle a fait ses classes et - vieille histoire toujours renouvelée – voilà que son moment est venu. Quand vous la verrez monter sur scène la prochaine fois – peut-être portera-t-elle son imper serré à la taille façon Mylène Demongeot dans « Tirez sur le pianiste » ? – approchez-vous donc. Vous verrez une chanteuse, une vraie.

Patrick Williams Journaliste à « ELLE », chanteur des Daltons.";s:8:"category";s:35:"Musique et son  / Groupe de musique";s:4:"pays";s:6:"France";s:15:"social_facebook";s:0:"";s:14:"social_twitter";s:0:"";s:13:"social_flickr";s:0:"";s:14:"social_myspace";s:0:"";s:17:"social_soundcloud";s:0:"";s:12:"social_vimeo";s:0:"";s:7:"created";s:19:"2011-06-09 13:32:08";s:8:"modified";s:19:"2011-07-11 14:56:04";}s:13:"ArtisteCompte";a:4:{s:2:"id";s:3:"244";s:6:"statut";s:5:"light";s:7:"created";s:19:"2011-06-09 13:32:08";s:8:"modified";s:19:"2011-06-09 13:32:08";}s:4:"Site";a:19:{s:2:"id";s:4:"2367";s:3:"url";s:27:"gloria-and-the-greenspiders";s:5:"title";s:27:"Gloria and The GreenSpiders";s:4:"logo";s:0:"";s:6:"slogan";s:22:"Fuck Now, Suffer Later";s:10:"id_gabarit";s:2:"13";s:11:"id_template";s:3:"359";s:11:"id_page_bio";s:4:"1713";s:12:"id_page_work";s:4:"1714";s:15:"id_page_contact";s:4:"1715";s:15:"id_page_galerie";s:3:"464";s:18:"id_page_evenements";s:4:"1716";s:9:"page_home";s:1:"5";s:10:"publishing";s:1:"1";s:8:"annuaire";s:1:"1";s:16:"annuaire_capture";s:22:"screenshot_default.jpg";s:10:"authorized";s:1:"0";s:7:"created";s:19:"2011-06-09 13:32:08";s:8:"modified";s:19:"2011-07-11 15:03:39";}s:4:"User";a:10:{s:2:"id";s:3:"282";s:10:"artiste_id";s:3:"262";s:5:"fb_id";s:0:"";s:8:"username";s:27:"gloria-and-the-greenspiders";s:8:"password";s:32:"fed62d6400a205d7765c273b20254c6f";s:5:"email";s:24:"gloriasometimes@yahoo.fr";s:5:"admin";s:1:"0";s:7:"actived";s:1:"1";s:7:"created";s:19:"2011-06-09 13:32:08";s:8:"modified";s:19:"2011-07-11 14:56:04";}}i:148;a:4:{s:7:"Artiste";a:21:{s:2:"id";s:3:"261";s:7:"user_id";s:3:"281";s:7:"site_id";s:4:"2343";s:16:"artistecompte_id";s:3:"243";s:3:"url";s:8:"kiaravan";s:5:"blase";s:8:"kiaravan";s:3:"nom";s:5:"pavan";s:6:"prenom";s:5:"julie";s:9:"id_avatar";s:81:"http://media.you-art-here.com/upload/kiaravan/avatar/Photo du 170945-07-00.02.jpg";s:6:"slogan";s:0:"";s:11:"description";s:25:"dessinatrice de mode   
