Alors qu'est-ce que je pourrai dire à propos de moi? Ah! Si je commençais par me présenter? Je m'appelle Blue Djoe et je suis votre hôte :)

Alors, "pourquoi Blue Djoe?" me direz-vous, et bien tout simplement que "Blue" est une référence à un surnom donné par des amis et que "Djoe" (prononcez Jo en accentuant le "J") est le diminutif de "Jonathan", j'aurai très bien pu me contenter de "Djoe" comme à l'époque mais il y en a déjà des masses sur la toile, ce qui m'obligeait parfois à rajouter un nombre à la fin, c'est pour ça que j'ai pensé à "Blue Djoe" qui est un condensé de mes deux surnoms, voili-voilou :)

A part ça je suis un passionné de dessin et de BD en tout genre quelque-soit l'origine, et bien sûr mon rêve serait de parvenir en faire mon métier.

J'avais déjà un blog auparavant (http://djoeart.canalblog.com) mais n'ayant plus le même état d'esprit qu'à cet époque j'ai eu envie d'en changer et de repartir sur quelque-chose de nouveau (http://bluedjoe.canalblog.com).
Mais il me fallait quelque-chose qui soit plus présentable, quelque-chose qui compléterait mon blog, Je me suis renseigné et c'est alors que l'on m'a conseillé cette plate-forme.

En espérant que mon site vous plaise je vous souhaite une agréable viste.

