avail le dirige vers une autre ; direction le paysage et cela lui reste pendant une dizaine d'années a l'aube des années 1990 il rencontre des peintre et plasticiens japonais et  la la révélation se fait l'art abstrait est sa seule poursuite dans son travail . la suite ne seras pas simple car l'art abstrait parait simple mais il n'en est rien avant de pouvoir exposer ses oeuvres il y auras du temps et du travail pour qu'il puisse trouver son univers et en 1996 le revoila dans des petites expositions il teste il écoute les critiques fusent bonnes moins bonnes , mes peu importe il persiste et quelques amis l'encouragent lui préparent des expositions les années passent il expose; il expose ; puis le malheur le frappe la perte d'ami très proche de parents problème de santée enfin la vie ! il laisse la peinture de coté et ce consacre a la photo d'art mais une rencontre vas tout remettre en question l'équilibre d'un nouveau couple le refait avancer cette personne nouvelle dans la vie vas lui donner tout les moyens pour se remettre a peindre et depuis 14 ans la peinture est dans sa tete le travail se fait son univers est  a nouveau en marche . aujourd'huit a 56 ans il ne voit que par la toile ,la peinture ,son atelier . de se chemin il retient une seul chose seul  on ne fait pas grand chose mais a deux tout est possible .la route , le chemin n'est pas fini.  ";s:8:"category";s:18:"Peinture / Peintre";s:4:"pays";s:6:"France";s:15:"social_facebook";s:0:"";s:14:"social_twitter";s:0:"";s:13:"social_flickr";s:0:"";s:14:"social_myspace";s:0:"";s:17:"social_soundcloud";s:0:"";s:12:"social_vimeo";s:0:"";s:7:"created";s:19:"2011-05-26 09:24:30";s:8:"modified";s:19:"2011-05-26 10:48:08";}s:13:"ArtisteCompte";a:4:{s:2:"id";s:3:"229";s:6:"statut";s:5:"light";s:7:"created";s:19:"2011-05-26 09:24:30";s:8:"modified";s:19:"2011-05-26 09:24:30";}s:4:"Site";a:19:{s:2:"id";s:4:"2209";s:3:"url";s:6:"midgil";s:5:"title";s:6:"MIDGIL";s:4:"logo";s:67:"http://media.you-art-here.com/upload/midgil/