Mon évolution... comme celle de tous les artistes, beaucoup de travail, beaucoup de créativité, et de fortes émotions pour transcender la créativité en oeuvres artistiques. 
J'aime créer pour le plaisir d'autrui, que ce soit avec une musique originale, aérienne qui transmet mes impressions, mes réalisations intérieures, ou composer un univers parallèle avec ma peinture sur cuivre où l'irréel transcende le quotidien dans un envol de couleurs, où la chaleur du bien-être se mélange à l'Amour et l'Espoir.

Oui, j'ai fait des études en France, avec deux diplômes universitaires de niveaux doctoral, mais cela ne m'empêche pas d'aimer plus que tout au monde, la créativité et le plaisir de créer, de transmettre. Je suis avant tout une artiste, aux idées avant-gardistes parfois dérangeantes. Mais cela ne m'empêche pas d'être un être humain, aux émotions fortes et sensibles. J'aime la vie, enfin la belle, celle qui permet à chacun d'être sans exploitations, et libre.


