à tous, sans pour autant amputer à la valeur de ce dernier. 	Fasicné par les taches depuis sa plus tendre enfance, il décida d'y articuler son travail.
	"-Les taches ont, pour moi, deux propriétés essentielles: leur caractére aléatoire et leur potentiel créatif inconscient. En effet, on aura beau répéter le geste créateur, le résultat ne sera jamais identique au précédent. Elles semblent porter cette petite étincelle de chaos.
	 Pourtant, lorsqu'on leur prête attention, on y voit des formes, des gestes, des émotions. Ainsi, tel devant les taches de Rorschach, deux personnes vont voir dans une même planche quelque chose de radicalement différent, quelque chose qui sera peut-être même révélateur."
	"-Dans cette série, j'ai voulu prendre à contrepied ces deux propriétés. Tout d'abord, j'ai voulu orienter l'inconscient. Je suis donc parti d'un dessin pour chacune des oeuvres que j'ai métissé avec des explosions d'encre noire afin de créer ce tracé hybride. 
	Puis je me suis attaqué à l'aléatoire que j'ai tenté de supprimer via la technique du pochoir. Ainsi la tache peut être représentée à l'identique, et à l'infini. Du moins c'est ce que je pensais."
	"-En effet, même la technique du pochoir produit des imperfections aléatoires. Quant à l'inconscient, certes une impression générale se dégage des oeuvres (Mort, Douceur, Création, Vie, Sexe) mais on ne peut parler d'orientation de l'inconscient. Il semble que la tache ne peut se séparer de sa nature chaotique."
	Chaque série comprend ainsi dix oeuvres, composée de cinq modéles variés en deux bichromies. Chaque oeuvre sera produite dix fois et numérotée, donnant ainsi naissance à dix versions de chaque série, puis les pochoirs sont brulés. Une seule série existe à l'heure actuelle.
