En 1999, diplômé d'une Maîtrise d'Histoire et d'Archéologie à l'université de la Sorbonne, sa première longue nouvelle (Al-Chimiste) imprimée sur l'imprimante, il part effectuer 16 mois de service militaire civil sous l'égide de de coopération française au Bénin (Afrique de l'Ouest).

De retour dans le Jura (ne me demandez pas pourquoi) il donne naissance à son premier enfant et laisse libre cours à sa passion pour les nouvelles technologies et l'informatique.Et c'est le drame. Il se met dans la tête d'écrire un roman d'anticipation : Stase 2.0, lui qui n'arrives que difficilement à prévoir l'âge qu'il aura dans un an...Profitant de sa formation d'éducateur spécialisé et du temps passé dans les cafés il se lance tout de même dans l'aventure, pour le meilleur et pour le pire.
